import React from 'react';
import styles from './NosotrosPage.module.css';

// --- Íconos para las secciones ---
const TargetIcon = () => <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><circle cx="12" cy="12" r="10"></circle><circle cx="12" cy="12" r="6"></circle><circle cx="12" cy="12" r="2"></circle></svg>;
const EyeIcon = () => <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"><path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z"></path><circle cx="12" cy="12" r="3"></circle></svg>;

// --- Datos para las nuevas secciones ---
const timelineData = [
    { year: '1995', event: 'Nace Hotel Veranum', description: 'Se funda el primer hotel en Santiago con la visión de ser un segundo hogar para los huéspedes.' },
    { year: '2005', event: 'Expansión a la V Región', description: 'Inauguramos nuestra primera sucursal en Viña del Mar, llevando nuestra hospitalidad a la costa.' },
    { year: '2015', event: 'Renovación Tecnológica', description: 'Implementamos un nuevo sistema de gestión y reservas online para optimizar la experiencia del cliente.' },
    { year: 'Hoy', event: 'Líderes en Hospitalidad', description: 'Con 30 años de historia, seguimos innovando para ofrecer una estadía inolvidable que combina tradición y modernidad.' }
];

const teamData = [
    { name: 'Fernanda Rojas', role: 'Gerente General', imageUrl: 'https://images.unsplash.com/photo-1573496359142-b8d87734a5a2?q=80&w=1888&auto=format&fit=crop' },
    { name: 'Carlos Vidal', role: 'Jefe de Operaciones', imageUrl: 'https://images.unsplash.com/photo-1557862921-37829c790f19?q=80&w=2071&auto=format&fit=crop' },
    { name: 'Isidora Núñez', role: 'Chef Ejecutiva', imageUrl: 'https://images.unsplash.com/photo-1595273670150-bd0cda73cde8?q=80&w=1887&auto=format&fit=crop' }
];

const NosotrosPage = () => {
    return (
        <div className={styles.nosotrosPage}>
            {/* HERO SECTION */}
            <header className={styles.heroSection}>
                <div className={styles.heroOverlay}></div>
                <div className="container">
                    <h1 className={styles.heroTitle}>30 Años Modernizando la Tradición Hotelera</h1>
                    <p className={styles.heroSubtitle}>En Hoteles VERANUM, combinamos décadas de experiencia con una visión fresca para ofrecerte una estadía inolvidable.</p>
                </div>
            </header>

            {/* TIMELINE SECTION */}
            <section className={styles.timelineSection}>
                <div className="container">
                    <h2 className={styles.sectionTitle}>Nuestra Trayectoria</h2>
                    <div className={styles.timeline}>
                        {timelineData.map((item, index) => (
                            <div key={index} className={styles.timelineItem}>
                                <div className={styles.timelineContent}>
                                    <span className={styles.timelineYear}>{item.year}</span>
                                    <h3 className={styles.timelineEvent}>{item.event}</h3>
                                    <p>{item.description}</p>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </section>

            {/* MISSION & VISION SECTION */}
            <section className={styles.missionVisionSection}>
                <div className="container">
                    <div className={styles.missionVisionGrid}>
                        <div className={styles.card}>
                            <div className={styles.cardIcon}><TargetIcon /></div>
                            <h3>Nuestra Misión</h3>
                            <p>Ofrecer una experiencia de hospitalidad excepcional, donde cada huésped se sienta valorado y cuidado, combinando confort, servicios de calidad y una atención personalizada.</p>
                        </div>
                        <div className={styles.card}>
                            <div className={styles.cardIcon}><EyeIcon /></div>
                            <h3>Nuestra Visión</h3>
                            <p>Ser la cadena hotelera líder en Chile reconocida por nuestra capacidad de innovar sin perder la calidez de la tradición, optimizando nuestra gestión a través de la tecnología.</p>
                        </div>
                    </div>
                </div>
            </section>
            
            {/* TEAM SECTION */}
            <section className={styles.teamSection}>
                <div className="container">
                    <h2 className={styles.sectionTitle}>Un Equipo Dedicado a Ti</h2>
                    <p className={styles.sectionSubtitle}>Detrás de cada detalle en VERANUM, hay un equipo de profesionales apasionados por el servicio.</p>
                    <div className={styles.teamGrid}>
                        {teamData.map((member, index) => (
                            <div key={index} className={styles.teamCard}>
                                <img src={member.imageUrl} alt={member.name} className={styles.teamImage} />
                                <div className={styles.teamInfo}>
                                    <h4 className={styles.teamName}>{member.name}</h4>
                                    <p className={styles.teamRole}>{member.role}</p>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            </section>
        </div>
    );
};

export default NosotrosPage;
